import React from 'react';

const OrderFooter = ({products}) => {
  return (
    <div className="row">
      <div className="button-wrapper">
        <div className="delete-button">
          <label htmlFor="all">
            <input type="checkbox" name="all" id="all" />
            All
          </label>
          <p>You have 0 Products on Your List</p>
          <button id="delete">Delete</button>
        </div>
        <div className="checkout-button">
          <label htmlFor="all">
            <input type="checkbox" name="all" id="all" />
            All
          </label>
          <p>You have 0 Products on Your List</p>
          <button id="checkout" checkoutData={products}>Checkout</button>
        </div>
      </div>
    </div>
  );
};

export default OrderFooter;
